import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import "./navibar.css";
import eventease_logo from "../Assests/eventease_logo.png";
import Image from "react-bootstrap/Image";

function CollapsibleExample() {
  const [activeItem, setActiveItem] = useState("Home");

  const handleItemClick = (itemName) => {
    setActiveItem(itemName);
  };

  const getNavItemStyle = (itemName) => {
    return activeItem === itemName ? "active-link" : "";
  };

  return (
    <div style={{ fontFamily: "Inter", fontWeight: "200px", fontSize: "120%" }}>
      <Navbar fixed="top" className="collapseOnSelect" bg="dark" variant="dark" expand="lg">
        <Container fluid>
          <div>
            <Navbar.Brand href="/">
              <Image
                src={eventease_logo}
                alt="EventEase Logo"
                style={{ height: "auto", width: "60%", padding: "5px 3%" }}
              />
            </Navbar.Brand>
          </div>
          <div>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
              <Nav className="me-auto"></Nav>
              <div className="button_navbar">
                <Nav style={{ gap: "1rem" }}>
                  <Nav.Link
                    id="each_button_navbar"
                    className={getNavItemStyle("Home")}
                    href="/"
                    onClick={() => handleItemClick("Home")}
                  >
                    Home
                  </Nav.Link>

                  <Nav.Link
                    id="each_button_navbar"
                    className={getNavItemStyle("Services")}
                    href="/services"
                    onClick={() => handleItemClick("Services")}
                  >
                    Services
                  </Nav.Link>

                  <Nav.Link
                    id="each_button_navbar"
                    className={getNavItemStyle("Events")}
                    href="events"
                    onClick={() => handleItemClick("Events")}
                  >
                    Events
                  </Nav.Link>

                  <Nav.Link
                    id="each_button_navbar"
                    className={getNavItemStyle("About Us")}
                    href="aboutus"
                    onClick={() => handleItemClick("About Us")}
                  >
                    About Us
                  </Nav.Link>

                  <Nav.Link
                    id="each_button_navbar"
                    className={getNavItemStyle("Contact Us")}
                    href="contactus"
                    onClick={() => handleItemClick("Contact Us")}
                  >
                    Contact Us
                  </Nav.Link>

                  <NavDropdown
                    title="Customer Name"
                    id="collasible-nav-dropdown"
                    className="right_corner"
                  >
                    <NavDropdown.Item href="profile">Profile</NavDropdown.Item>

                    <NavDropdown.Item href="appointments">Appointments</NavDropdown.Item>

                    <NavDropdown.Item href="bookings">Bookings</NavDropdown.Item>
                    <NavDropdown.Divider />

                    <NavDropdown.Item href="#action/3.4">Log Out</NavDropdown.Item>
                  </NavDropdown>
                </Nav>
              </div>
            </Navbar.Collapse>
          </div>
        </Container>
      </Navbar>
    </div>
  );
}

export default CollapsibleExample;
